import React from "react";

const Tooltip = ({ children, text }) => {
  return (
    <div className="p-16">
      <span className="font-semibold">{text}</span>
    </div>
  );
};

function TooltipContent() {
  return (
    <p className="border rounded-xl bg-black text-white p-3 inline-block">
      {children}
    </p>
  );
}
export default Tooltip;
